	return ''
	       + (before ? (before + separator) : '')
	       + negative
	       + (cast_pos ? integer_part.substr(0, cast_pos) + separator : '')
	       + integer_part.substr(cast_pos).replace(/(\d{3})(?=\d)/g, '$1' + separator)
